import React from 'react'
import Tetris from './Tetris'
import LeaderBoard from './LeaderBoard'

export default function MainBody(props) {
    return (
        <div>
            <Tetris/>
            <Route path="/leaderBoard" render={() => <LeaderBoard scores={props.scores}/>}/>
        </div>
    )
}
